import '../App.css';
import React from "react";
import { useState, useEffect, useMemo } from "react";
import { useNavigate, Link } from "react-router-dom";
import axios from "axios";
import logo from "../components/back.png";


const ShowST = () => {

    const navigate = useNavigate();
    const [images, setImages] = useState([]);

    useEffect(() => {
        fetch("http://127.0.0.1:5000/get-images")
        .then((res) => res.json())
        .then((data) => setImages(data))
        .catch((err) => console.error("Error fetching images:", err));
    }, []);


    return (
        <div className="Containner-showdis">
            <p className='Text-show'>Prediction</p>
            <div className='Img-con'>
            {/* {imageBase64.map((src, index) => (
                <div key={index} className="image-container">
                    <img src={src} alt={`Flask Image ${index}`} className='image'/>
                    <div key={index} className='Div-result'>
                        <p key={index} className='Text-name'>Name : </p>
                        <p key={index} className='Text-result'>Result : </p>
                    </div>
                </div>
            ))} */}
            {images.map((item, index) => (
                <div key={index} className="image-container">
                <img src={item.src} alt={item.name} className='image'/>
                <p>{item.name}</p>
                </div>
            ))}
            </div>
            <div className='Div-back'>
            <Link to="/show" className="logo">
                <img src={logo} alt="" className="Back-ele" />
            </Link>
            <p className='Back-text'>back</p>
            </div>
        </div>
    );
};

export default ShowST;
